(function() {
  var ballRadius, canvas, ctx, cx, cy, draw, drawBall, wallCollideCheck, x, y;

  canvas = $("#game-screen")[0];

  ctx = canvas.getContext("2d");

  x = canvas.width / 2;

  y = canvas.height - 30;

  cy = 2;

  cx = 2;

  ballRadius = 10;

  wallCollideCheck = function() {
    if (y + cy < ballRadius || y + cy > canvas.height - ballRadius) {
      return cy = -cy;
    } else if (x + cx < ballRadius || x + cx > canvas.width - ballRadius) {
      return cx = -cx;
    }
  };

  drawBall = function() {
    ctx.beginPath();
    ctx.arc(x, y, ballRadius, 0, Math.PI * 2);
    ctx.fillStyle = "blue";
    ctx.fill();
    ctx.closePath();
    return null;
  };

  draw = function() {
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    drawBall();
    wallCollideCheck();
    y += cy;
    return x += cx;
  };

  $(document).ready(function() {
    return setInterval(draw, 30);
  });

}).call(this);

